	/**
	 *	Loads an internal array of instances (servers) and other OpenStack data
	 *
	 *	@param data		Array of servers to load
	 */
	$scope.loadInitialServers = function(data) {
		// console.log(data);console.log(JSON.stringify(rou));
		data.images.forEach(function(img) { img.path = $scope.getNodePath('images', img); $scope.clusterdata.images.push(img); $scope.clusterdata.lookup[img.id] = img });
		data.networks.forEach(function(net) { $scope.addNodeToDash(net, 'networks', 'Network', true) });
		data.servers.forEach(function(serv) { $scope.addNodeToDash(serv, 'servers', 'Server', true) });
		data.routers.forEach(function(rou) { $scope.addNodeToDash(rou, 'routers', 'Router', true) });
		data.ports.forEach(function(port) { $scope.addLinkToDash(port, 'ports', 'Port', true) });
		data.volumes.forEach(function(vol) { $scope.addNodeToDash(vol, 'volumes', 'Volume', true); $scope.addLinkToDash(vol, 'volumes', 'Volume', true) });
		data.flavors.forEach(function(flav) { $scope.clusterdata.flavors.push(flav) });
		data.meters.forEach(function(met) { $scope.clusterdata.meters.push(met) });

		// console.log($scope.entityTypes)
		console.log($scope.clusterdata);
		// console.log("We should have just loaded everything.")
		$scope.createHeatmap();

	}

	$scope.addNodeToDash = function(node, typeKey, type, refresh) {
		if ($scope.entityTypes[type] === undefined) { $scope.entityTypes[type] = {'name': type, 'status': true} };
		$scope.clusterdata.lookup[node.id] = node;

		node.type = type;
		node.typeKey = typeKey;
		node.class = node['router:external'] ? 'publicnetworks' : typeKey;
		node.nodeSize = $scope.nodeSize[node.class] || 16;
		node.nodeColor = $scope.getNodeColor(node.class);
		node.nodePathName = $scope.getNodePath(node.class, node);
		node.nodePath = $scope.nodePaths[node.nodePathName]
		node.nodePathOffset = $scope.getIconOffset(node.class, node);
		node.nodePathScale = $scope.getIconScale(node.class, node)
		node.metrics = {}

		if (typeKey == 'network') {}
		else if (typeKey == 'servers') {
			node.volumes = [];
		}
		
		// console.log(node);
		$scope.clusterdata.nodes.push(node);
		if (refresh) {$scope.updateForceGraph();}
	}

	$scope.addLinkToDash = function(link, typeKey, type, refresh) {
		if ($scope.entityTypes[type] === undefined) { $scope.entityTypes[type] = {'name': type, 'status': true} };
		$scope.clusterdata.lookup[link.id] = link;

		link.typeKey = typeKey;
		
		var l1, l2;
		if (typeKey == 'ports') {
			// console.log(link)
			l1 = link.device_id;
			l2 = link.network_id;
			link.name = "port " + link.id
			link.class = typeKey;
			link.nodePathName = $scope.getNodePath(link.class, link);
			link.nodePath = $scope.nodePaths[link.nodePathName]
			link.nodeColor = $scope.getNodeColor(link.class)
		} 
		else if (typeKey == 'volumes') {
			if (link.attachments.length) {
				l1 = link.id;
				l2 = link.attachments[0].server_id;
				// @TODO Lets add a reference to this volume in the attached server for ease
			} else { return; }
		} else {
			console.log("Something went wrong making a link!")
			return;
		}

		var s = $scope.clusterdata.nodes.filter(function(n1) {return n1.id == l1});
		var t = $scope.clusterdata.nodes.filter(function(n2) {return n2.id == l2});

		if (s.length > 0 && t.length > 0) {
			link.source = s[0]['index'];
			// link.source.type = 50;
			link.target = t[0]['index'];
			if (typeKey == 'volumes') {
				t[0].volumes.push(link);
			}

		} else {
			// console.log("Something odd happened...")
			return;
		}

		$scope.clusterdata.edges.push(link);
		if (refresh) {$scope.updateForceGraph();}
	}

	/**
	 *	Loads a new force graph in the center pane.
	 */
	function loadNewForceGraph() {

		var w = $('#pane-center').width(); // Lets make these in scope so we can change them easily
		var h = $('#pane-center').height();

		force = d3.layout.force()
			.nodes($scope.clusterdata.nodes)
			.links($scope.clusterdata.edges)
			.size([w, h])
			.linkDistance(function(d){return $scope.getNodeLinkSize(d.source.typeKey)})
			.linkStrength(1)
			.gravity(0.15)//(function(d) { return $scope.getNodeGravity(d.type) })
			.friction(0.7)
			.charge(function(d) { return $scope.getNodeCharge(d.typeKey) });

		svg = d3.select("#pane-center").append("svg")
			.attr("width", w)
			.attr("height", h)
			.call(zoom = d3.behavior.zoom().scaleExtent([0.2, 5])
			.on("zoom", $scope.redrawCanvas))
			.on("dblclick.zoom", null)
			.on("contextmenu.zoom", null);

		innervis = svg.append("svg:g").append("svg:g");
		innervis.append("g").attr("class", "links");
		innervis.append("g").attr("class", "nodes");

		edges = svg.select(".links").selectAll("line");
		nodes = svg.select(".nodes").selectAll("circle");	

		//Every time the simulation "ticks", this will be called
		force.on("tick", function() {
			edges.attr("x1", function(d) { return d.source.x; })
				.attr("y1", function(d) { return d.source.y; })
				.attr("x2", function(d) { return d.target.x; })
				.attr("y2", function(d) { return d.target.y; });

			nodes.attr("transform", function(d) { return "translate(" + (d.x - d.nodePathOffset.x) + "," + (d.y - d.nodePathOffset.y) + "), scale(" + d.nodePathScale + ")"; })
					.attr("child", function(d) { $("#circle-" + d.id)
					.attr("transform", "translate(" + d.x + "," + d.y + ")"); return "updated"; })
					.attr("text", function(d) { $("#label-" + d.id)
					.attr("transform", "translate(" + d.x + "," + (d.y + $scope.getNodeTextOffsetY(d.typeKey)) + ")"); return "updated"; })
					.on('click', function(d) {console.log(d)});

		});
	}

	$scope.updateForceGraph = function() {
		edges = edges.data( $scope.clusterdata.edges, function(d) { return d.source.index + "-" + d.target.index; });
		edges.enter().append("line")
			.style("stroke", "#CCC")
			.style("stroke-width", 4)
			.on('click', function(d) { $scope.selectNode(d); });
		edges.exit().remove();

		nodes = nodes.data($scope.clusterdata.nodes, function(d) { return d.name ;})
		nodes.enter().append("circle")
			.attr("id", function(d) { return "circle-" + d.id })
			.attr("r", function(d) { return d.nodeSize })
			.style("opacity", function(d) {return $scope.getNodeOpacity(d.name)})
			.style("fill", function(d, i) {	return d3.rgb(d.nodeColor); })
			.attr("stroke-width", function(d){if (d.class == "servers"){return 2} else {return 0}})
			.attr("stroke", function(d){if (d.typeKey == "servers") {return $scope.getServerStateColor(d.status)} else {return "transparent"} })
			.call(force.drag)
			.on("mousedown", $scope.disableRedraw)
			.on("mouseup", $scope.enableRedraw)
			.on('click', function(d) { $scope.selectNode(d); })
			.transition()
			.duration(750)
			.ease("elastic");

		nodes.enter().append('text')
			.text(function(d) { return d.name })
			.attr("id", function(d) { return "label-" + d.id })
			.attr('class', $scope.labelVisible ? 'label' : 'label hidden' )
			.attr('text-anchor', 'middle');

		nodes.enter().append("path")
			.attr("d", function(d) {return d.nodePath ? d.nodePath : $scope.nodePaths[d.nodePathName]})
			.attr("id", function(d) { return d.id })
			.style("fill", function(d, i) {	return d3.rgb("#FFF"); })
			.attr("class" ,"nodeicon")
			.attr("transform", function(d) { return "translate(" + (d.nodePathOffset.x) + "," + (d.nodePathOffset.y) + "), scale(" + d.nodePathScale + ")"; })
			.on("mousedown", $scope.disableRedraw)
			.on("mouseup", $scope.enableRedraw)
			.on('click', function(d) { $scope.selectNode(d); });

		nodes.exit().remove();
		force.start();
	}

