	$scope.getNodeOpacity = function(name) {
		if ($scope.selectedNodes.length === 0) {	return 1;	}
		else {
			if ($scope.selectedNodes.indexOf(name) >= 0) {	return 1;	}
			else {	return 0.5	}
		}
	}

	$scope.getNodePath = function(type, node) {
		if (type == 'servers') {
			var image = $.grep($scope.clusterdata.images, function(e) { return e.id == node.image.id} )
			if (image) { return image[0].path; } 
			else { return 'port' }
		} else if (type == 'images') {
			var imagename = node.name.toLowerCase();
			for (var i in $scope.imageList) {
				if (imagename.indexOf($scope.imageList[i]) != -1 && $scope.nodePaths[$scope.imageList[i]]) {
					return $scope.imageList[i];
				} else if ($scope.imageLookup[$scope.imageList[i]].length > 0) {
					for (var j in $scope.imageLookup[$scope.imageList[i]]) {
						if (imagename.indexOf($scope.imageLookup[$scope.imageList[i]][j]) != -1 && $scope.nodePaths[$scope.imageList[i]]) {
							return $scope.imageList[i];
						}
					}
				}
			}
			return 'port';
		} else {
			return $scope.nodePaths[$scope.nodeShapes[type]] ? $scope.nodeShapes[type] : undefined;
		}
	}

	$scope.createHeatmap = function() {
		var config = {
			"width": window.screen.width,//$('#pane-center').width(),
			"height": window.screen.height,//$('#pane-center').height(),
			"radius": 150,
			"element": document.getElementById("pane-center"),
			"visible": true,
			"opacity": 25,
			"gradient": { 0.0: "rgb(0,0,197)", 0.3: "rgb(0,255,255)", 0.6: "rgb(0,255,0)", 0.8: "yellow", 1: "rgb(255,0,0)" }
		};
		heatmap = h337.create(config);

		if ($scope.heatMapVisible) {
			getOpenStackData($scope.saveCpuUtil, "statistics");
			setTimeout(function() {$scope.updateHeatmapReal();}, 3000)
		}
	}

	$scope.saveCpuUtil = function(data) {
		var d = cleanArrayItems(data.stats, "resource_id")
		var keys = Object.keys(d)
		// console.log(d)

		for (var i in keys) {
			var key = keys[i]
			var util = d[key];
			var server = $.grep($scope.clusterdata.nodes, function(e) { return e.id == key} )
			if (server) {
				if (server[0].metrics.cpu_util === undefined) {	server[0].metrics.cpu_util = {} }
				server[0].metrics.cpu_util[util.timestamp] = util.counter_volume;
			}
		}
		
		if ($scope.getCpuUtil == true) {
			setTimeout(function() {getOpenStackData($scope.saveCpuUtil, "statistics");}, 10000);
		}
	}

	$scope.updateHeatmapReal = function(meter, type) {
		heatmap.store.setDataSet({ max: 100, data: []}); // Wipe the slate clean
		if ($scope.heatMapVisible) {
			// console.log("we're updating our heatmap!")
			if (!type) {type = "servers"}; if (!meter) {meter = "cpu_util"}
			var nodes = $.grep($scope.clusterdata.nodes, function(e) { return e.class == type } )
			for (var i in nodes) {
				var node = nodes[i]
				if (node.metrics[meter] && node.status != "SHUTOFF") {
					var j = Object.keys(node.metrics[meter]);
					var value = node.metrics[meter][j[j.length - 1]]//clusterdata["servers"][i]["statistics"]["cpu_util"][latestts[latestts.length - 1]];
					if (value === undefined) {
						value = 0;
						value -= (10 * Math.random()) * (Math.log(Math.random()));
					}
					var nodeid = "#circle-" + node.id;
					var node_heat_x = $(nodeid).position()['left'] + offsetx;//node.x// + offsetx;
					var node_heat_y = $(nodeid).position()['top'] + offsetx;//node.y// + offsety;
					heatmap.store.addDataPoint(node_heat_x, node_heat_y, value); //+ rand);
				}
			}
			setTimeout($scope.updateHeatmapReal, 1000);
		}
	}

	$scope.selectNode = function(d) {
		if (d === undefined ) {
			$scope.selectedNode = undefined;
			$('#pane-east').width('0px')
		}
		if ($scope.selectedNode == d) {
			$scope.search = true;
			// myLayout.slideOpen('east');
		}
		$scope.selectedNode = d;
		console.log($scope.selectedNode);
	}

	$scope.toggleSearch = function(state) {
		$scope.search = state;
		if (!state) {
			$(':focus').blur()
		}
	}

	$scope.resetCanvas = function() {
		zoom.scale(1);
		zoom.translate([0,0]);
		innervis.attr("transform", "translate(" + zoom.translate() + ")" + " scale(" + zoom.scale() + ")");
	}

	$scope.redrawCanvas = function(entity) {
		innervis.attr("transform", "translate(" + d3.event.translate + ")" + " scale(" + d3.event.scale + ")");
		offsetx = 18 * d3.event.scale;
		offsety = 18 * d3.event.scale;
	}

	$scope.developerMode = function(size) {
		for (var i in $scope.imageList) {
			var img = { id: inventResourceID(), name: $scope.imageList[i] }
			img.path = $scope.getNodePath('images', img);
			 $scope.clusterdata.images.push(img); 
			 $scope.clusterdata.lookup[img.id] = img;
		}
		$scope.createRandomCluster(size)
	}

