hz.filter('cut', function() {
	return function (value, wordwise, max, tail) {
	if (!value) return '';

	max = parseInt(max, 10);
	if (!max) return value;
	if (value.length <= max) return value;

	value = value.substr(0, max);
	if (wordwise) {
	    var lastspace = value.lastIndexOf(' ');
	    if (lastspace != -1) {
	        value = value.substr(0, lastspace);
	    }
	}

	return value + (tail || '');
	};
})

hz.directive('clickAnywhereButHere', function($document){
	return {
		restrict: 'A',
		link: function(scope, elem, attr, ctrl) {
			elem.bind('click', function(e) { e.stopPropagation(); });
			$document.bind('click', function() { scope.$apply(attr.clickAnywhereButHere); })
		}
	};
});

hz.directive('glyphicon', function() {
	return {
		restrict: 'E',
		scope: { icon: '&' },
		compile: function(element, attrs) {
			var icon = attrs.icon || 'asterisk';
			// console.log(icon);
			var htmlText = '<span class="glyphicon glyphicon-' + icon + '"></span>';
			element.replaceWith(htmlText);
		}
	}
});
